[{"location":"xfmr/#Transformer-Model","page":"Transformer","title":"Transformer Model","text":"","category":"section"},{"location":"xfmr/#","page":"Transformer","title":"","text":"","category":"section"},{"location":"xfmr/#Transformer-Excitation","page":"Transformer","title":"Transformer Excitation","text":"","category":"section"},{"location":"xfmr/#Theoretical-Background","page":"Transformer","title":"Theoretical Background","text":"","category":"section"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"In the time domain, the transformer excitation voltage~e(t)\\,[V] and magnetization current~i^m(t)\\,[A] are related through the BH-curve:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"beginalign\n    e(t) rightarrow B(t) stackrelmboxBH-curverightarrow H(t) rightarrow i^m(t)\nendalign","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"Illustration of the relationship between the excitation voltage~e(t) and magnetization current~i^m(t)","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"The transformer excitation voltage~e(t) relates to its magnetic flux density~B(t)\\,[T]:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"beginalign\n    B(t)    = sum_h in H fracE_hA cdot omega_h cdot cos(omega_h cdot t + theta_h) \n    mboxgiven  nonumber \n    e(t)    = sum_h in H E_h cdot sin(omega_h cdot t + theta_h) \n    B(t)    = frac1A int -e(t) mathrmdt\nendalign","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"where~A\\,[m^2], omega_h\\,[rad/Hz], E_h\\,[V] and~theta_h\\,[rad] denotes the core surface, harmonic angular frequency, harmonic excitation voltage magnitude and phase angle, respectively. The link between the frequency-domain excitation current~E\\,[pu] and the time-domain excitation voltage~e(t), and consequently the magnetic flux density~B(t), is provided through the following functions, depending on the chosen excitation voltage formulation E_formulation, i.e., :polar or :rectangular.","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"HarmonicPowerModels.magnetic_flux_density_polar(E::Vector{<:Real}, θ::Vector{<:Real}, ω::Vector{<:Real}, t::Vector{<:Real}, A::Real, Vbase::Real)","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"HarmonicPowerModels.magnetic_flux_density_rectangular(Ere::Vector{<:Real}, Eim::Vector{<:Real}, ω::Vector{<:Real}, t::Vector{<:Real}, A::Real, Vbase::Real)","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"The transformer magnetization current~i^m(t) relates to its magnetic field intensity~H(t)\\,[Ampere-turn/meter]:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"beginalign\n    i^m(t)  = H(t) cdot l\nendalign","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"where~l\\,[m] denotes the mean magnetic path. The frequency-domain magnetization current~I^e\\,[pu] is determined through a Fourrier transform of the time-domain magnetization current~i^m(t), adjusted for current basis. Depending on the chosen excitation voltage formulation E_formulation, the frequency-domain magnetization current is expressed in :polar or :rectangular coordinates.","category":"page"},{"location":"xfmr/#Implementation","page":"Transformer","title":"Implementation","text":"","category":"section"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"    HarmonicPowerModels.sample_xfmr_excitation(data::Dict{String, <:Any}, xfmr_exc::Dict{Int, Dict{String, <:Any})","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"All excitation data are stored in a dictionary xfmr_exc with:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"key = id of the xfmr [Int]\nval = a dictionary [Dict{String,Any}] consisting of the following input:\nGeneral input, including:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"key type description\n\"Hᴱ\" Vector{Int} set of relevant excitation voltage harmonics\n\"Hᴵ\" Vector{Int} set of relevant magnetizing current harmonics\n\"Fᴱ\" Symbol excitation voltage formulation, i.e., :rectangular or :polar\n\"Fᴵ\" Symbol magnetization current formulation, i.e., :rectangular or :polar\n\"l\" Real mean magnetic path [m]\n\"A\" Real core surface [m^2]\n\"N\" Int nominal primary turns [-]\n\"BH\" Function anonymous function for the inversed BH-curve [T//A-turns/m]","category":"page"},{"location":"hosting_capacity/#Harmonic-Hosting-Capacity","page":"HHC","title":"Harmonic Hosting Capacity","text":"","category":"section"},{"location":"hosting_capacity/#Goal-of-the-Problem-Formulation","page":"HHC","title":"Goal of the Problem Formulation","text":"","category":"section"},{"location":"hosting_capacity/","page":"HHC","title":"HHC","text":"The harmonic hosting capacity problem aims at determining the maximum amount of  harmonic current that may be injected in order for a subset of the following  technical limits not to be exceeded:","category":"page"},{"location":"hosting_capacity/","page":"HHC","title":"HHC","text":"individual harmonic voltage distortion limits\ntotal harmonic voltage distortion limits\nrms voltage limits","category":"page"},{"location":"optimal_power_flow/#Harmonic-Optimal-Power-Flow","page":"HOPF","title":"Harmonic Optimal Power Flow","text":"","category":"section"},{"location":"bus/","page":"Bus","title":"Bus","text":"The decison is made to keep the shunt, however, know that this is interpreted as a pure capacitive or indicive shunt, i.e., no k-ratio. If such behavior is needed than you should use a passive filter.","category":"page"},{"location":"#HarmonicPowerModels.jl-Documentation","page":"Home","title":"HarmonicPowerModels.jl Documentation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = HarmonicPowerModels","category":"page"},{"location":"","page":"Home","title":"Home","text":"HarmonicPowerModels.jl is an extension package of PowerModels.jl for Steady-State  Power System Optimization with Power Harmonics. ","category":"page"},{"location":"#Core-Problem-Specification","page":"Home","title":"Core Problem Specification","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Balanced Harmonic Power Flow (hpf)\nIVR (IVRPowerModel)\nBalanced Harmonic Optimal Power Flow (hopf)\nIVR (IVRPowerModel)\nBalanced Harmonic Hosting Capacity (hhc)\nDeterministic NLP (dHHC_NLP <: IVRPowerModel)\nDeterministic SOC (dHHC_SOC <: IVRPowerModel)","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"The package requires Julia 1.9 or newer. The latest stable release of HarmonicPowerModels can be installed using the Julia package manager with","category":"page"},{"location":"","page":"Home","title":"Home","text":"] add HarmonicPowerModels","category":"page"},{"location":"","page":"Home","title":"Home","text":"At least one solver is required for running HarmonicPowerModels.  The open-source solver Ipopt is recommended, as it is fast, scaleable and can be used to solve a wide variety of the problems provided in HarmonicPowerModels. The Ipopt solver can be installed via the package manager with","category":"page"},{"location":"","page":"Home","title":"Home","text":"] add Ipopt","category":"page"},{"location":"","page":"Home","title":"Home","text":"Test that the package works by running","category":"page"},{"location":"","page":"Home","title":"Home","text":"] test HarmonicPowerModels","category":"page"},{"location":"#Acknowledgements","page":"Home","title":"Acknowledgements","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"The primary developer is Tom Van Acker, BASF Antwerp, (@timmyfaraday), with support from the following contributors: ","category":"page"},{"location":"","page":"Home","title":"Home","text":"Hakan Ergun, KU Leuven, (@hakanergun), and\nFrederik Geth, GridQube, (@frederikgeth).","category":"page"},{"location":"#License","page":"Home","title":"License","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This code is provided under a BSD 3-Clause License.","category":"page"},{"location":"power_flow/#Harmonic-Power-Flow","page":"HPF","title":"Harmonic Power Flow","text":"","category":"section"}]
